contracts/proposal.sol.content:
// SPDX-License-Identifier: MIT
pragma experimental ABIEncoderV2;
pragma solidity ^0.6.0;

contract Proposal {
    
    struct Proposal{
        uint proposalId;
        uint proposalStatus;
        uint proposalCreator;
        // mapping (uint => Voter) voters;
        // mapping (uint => proposalOption) options;
    }

    mapping (address => Proposal) proposalStructs;

    address[] public proposalList;

    function createProposal(uint _proposalId, uint _proposalStatus, uint _proposalCreator) public {
        proposalStructs[msg.sender].proposalId = _proposalId;
        proposalStructs[msg.sender].proposalStatus = _proposalStatus;
        proposalStructs[msg.sender].proposalCreator = _proposalCreator;
        proposalList.push(msg.sender);
    }


    // struct proposalOption{
    //     string option;
    // }

    // struct Voter{
    //     uint id;
    //     string voterAddress;
    //     bool isVoted;
    // }    

}

